import React from 'react';
import './css/style.css';
import './img';
import './fonts/fontawesome-free-5.15.3-web/css/all.css';

const ShopPage = () => {

return (
    <div id="main">
        <div id="header">
            <div className="footer-heading">
                shop bóng bàn Mạnh Dũng
            </div>
        </div>

        <div id="content" style={{ marginBottom: 0, paddingBottom: 0 }}>
            <div className="log-in">
                <form className="log-in-box">
                    <label htmlFor="account">Tên đăng nhập: <br /></label>
                    <input type="text" name="account" id="account" /> <br />
                    <label htmlFor="password">Mật khẩu: <br /></label>
                    <input type="password" name="password" id="password" />
                    <button type="submit" className="btn-log-in">Đăng nhập</button>
                </form>
            </div>
        </div>
    </div>
);
};

export default ShopPage;
